class Solution(object):
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        u={}
        for i in range(len(p)):
            if p[i] in u:
                u[p[i]]+=1
            else:
                u[p[i]]=1
        i=0
        res=[]

        while i<=len(s)-len(p):
            j=0
            cu={}
            found=True
            while j<len(p):
                if s[i+j] in u and (s[i+j] not in cu or (cu[s[i+j]]<u[s[i+j]])):
                    if s[i+j] not in cu:
                        cu[s[i+j]]=1
                    else:
                        cu[s[i+j]]+=1
                elif (s[i+j] in u and cu[s[i+j]]>=u[s[i+j]]) or s[i+j] not in u:
                    found=False
                    break
                j+=1
            if found:
                res.append(i)
            i+=1
        return res

    def findAnagrams2(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        def isAnagram(expected, actual):
            if len(expected)!=len(actual):
                False
            for  k,v in expected.items():
                if k not in actual:
                    return False
                if actual[k]!=v:
                    return False
            return True
        
        if len(s)==0 or len(p)>len(s):
            return []
        u={}
        for i in range(len(p)):
            if p[i] in u:
                u[p[i]]+=1
            else:
                u[p[i]]=1
        i=0
        res=[]
        cur={}

        for i in range(len(p)):
            if s[i] in cur:
                cur[s[i]]+=1
            else:
                cur[s[i]]=1

        if isAnagram(u,cur):
            res.append(0)

        # if cur[s[0]]>0:
        #     cur[s[0]]-=1
        # else:
        #     del cur[s[0]]


        i=1
        while i<=len(s)-len(p):

            if cur[s[i-1]]>0:
                cur[s[i-1]]-=1
            else:
                del cur[s[i-1]]
        
            if s[i+len(p)-1] in cur:
                cur[s[i+len(p)-1]]+=1
            else:
                cur[s[i+len(p)-1]]=1
        
            if isAnagram(u,cur):
                res.append(i)
            i+=1
        return res


            

            

